#include<bits/stdc++.h>using namespace std;typedef long long ll;void f(ll n,vector<ll>&a){    for(ll i=0;i<n;i++)cin>>a[i];}unordered_map<ll,ll>mp;vector<ll>res;bool check(ll low,set<ll>&st,ll k){    ll i=low;    while (low<=k && st.find(low)!=st.end()){        mp[low]=1;        low+=i;    }     return low>k;}void solve(){    ll n,k;    cin>>n>>k;        set<ll>st;    for (ll i = 0; i < n; i++)    {        ll a;        cin>>a;        st.insert(a);    }    for(auto it=st.begin();it!=st.end();it++){        if(mp[*it]==0){            if(check(*it,st,k))                res.push_back(*it);            else{                cout<<"-1"<<'\n';                return;            }        }    }    cout<<res.size()<<'\n';    for(ll i:res)cout<<i<<" ";    cout<<'\n';} int main(){ll t;cin>>t;while (t--){    mp.clear();    res.clear();    solve();}     return 0;}